// export default FC;


// list and keys and conditional rendering

const FC = () =>{
    const lang = [
        {id:1, langaguge:'Tel'},
        {id:2, langaguge:'Eng'},
        {id:3, langaguge:'Hin'}
    ]
    return(
        <>
        {lang.map((ele) =>{
            return <li key={el.id}>{lang.langaguge}</li>
        })}
        </>
    )
}

export default FC;
